import { useState } from "react";
import api from "../api";


const SubsComponent = () => {

    const [subData, setSubData] = useState([]);

    api.get('/user/active-subs').then(response => {
        console.log(response.data);

    });


    return (
        <div>
            <p>Active subs</p>
            {subData.map(subs => (
                <div key={subs.id}>
                  <div> </div>  {subs.active}
                    </div>
              

            ))}
           

        </div>
    )
}


export default SubsComponent;
